  return (
    <nav className="bg-black text-white px-6 py-4 shadow-md sticky top-0 z-50">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold">ðŸŒ™ Midnight Spa</h1>
        <ul className="flex space-x-4 text-sm sm:text-base">
          <li><Link to="/" className="hover:text-pink-400">Home</Link></li>
          <li><Link to="/services" className="hover:text-pink-400">Services</Link></li>
          <li><Link to="/offers" className="hover:text-pink-400">Offers</Link></li>
          <li><Link to="/about" className="hover:text-pink-400">About</Link></li>
          <li><Link to="/contact" className="hover:text-pink-400">Contact</Link></li>
        </ul>
      </div>
    </nav>
  );
}

